package com.bdca.sense.entity;

import java.util.List;
import java.util.Map;

import io.swagger.annotations.ApiModelProperty;

public class SenseDTO {

	@ApiModelProperty(value = "图像Base64字符串", required = true)
	private String bases64;// 

	@ApiModelProperty(value = "自定义识别范围框")
	private List<Rect> boxes;

	@ApiModelProperty(value = "自定义识别范围和识别结果目标的匹配是否要求全包含：true-包含关系；false-相交关系", allowableValues = "true,false")
	private boolean inclusive;

	@ApiModelProperty(value = "其他自定义参数和值")
	private Map<String, Object> options;

	@ApiModelProperty(value = "识别结果参数和值")
	private Map<String, Object> result;

	public String getBases64() {
		return bases64;
	}

	public void setBases64(String bases64) {
		this.bases64 = bases64;
	}

	public List<Rect> getBoxes() {
		return boxes;
	}

	public void setBoxes(List<Rect> boxes) {
		this.boxes = boxes;
	}

	public Boolean getInclusive() {
		return inclusive;
	}

	public void setInclusive(Boolean inclusive) {
		this.inclusive = inclusive;
	}

	public Map<String, Object> getOptions() {
		return options;
	}

	public void setOptions(Map<String, Object> options) {
		this.options = options;
	}

	public Map<String, Object> getResult() {
		return result;
	}

	public void setResult(Map<String, Object> result) {
		this.result = result;
	}

}
